import  "./at.css"

export default function At1() {
  return (
    <div >
      <h3 className="title">The night that changed my life</h3>
      <ul>
        <li>When I changed from a negative attitude to a positive attitude. I felt better. I had more energy. And I started to accomplish goals that I believed I could never accomplish before</li>
      </ul>
    </div>
  )
}
